import { borderRadius, fontSize } from "@mui/system";
import React from "react";

import cert_aws from "../img/certificate/aws.jpg";
import Position from "rsuite/esm/internals/Overlay/Position";

const styleCard = {
    height: "300px",
    width: "220px",
    paddingBottom: "20px",
    borderRadius: "20px",
    boxShadow: "0px 8px 16px 0px rgba(0,0,0,0.2)",
    borderStyle: "solid",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
}

const styleImage = {
  width: "auto",
  height: "50%",

  Position: "relative"
}


function CertificateCard(props){
  const image = cert_aws;
  const title = "AWS for Beginner"

  return (
    <div style={styleCard}>
        <img src={cert_aws} style={styleImage}/>
    </div>
  )
}

export default CertificateCard;
